import React from 'react';
import ReactDOM from 'react-dom/client';
import Cards from './Cards';
import './index.css';
import sData from './cardLists';

const sDataNewfunction = (val)=>{
    return <Cards srcImage={val.srcImage} typeTrend={val.typeTrend} title={val.title} />
}

var root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
    <React.Fragment>
        {sData.map(sDataNewfunction)}    
</React.Fragment>
);
